const Laptop = props => {
   return(
      <h1>해당 노트북은 {props.brand}입니다.</h1>
   )
}

Laptop.defaultProps ={
   brand : "LG"
}

const Wrapper = props =>{
   return(
      <h1>자식 엘리먼트의 개수는 {props.children.length}입니다.</h1>
   )
}

export {Laptop, Wrapper};
